CREATE TABLE IF NOT EXISTS olis_facilities (
                                               `licence_number` INT,
                                               `facility_name` VARCHAR(253) CHARACTER SET utf8,
                                               `facility_address_line1` VARCHAR(68) CHARACTER SET utf8,
                                               `facility_address_line2` VARCHAR(32) CHARACTER SET utf8,
                                               `facility_address_city` VARCHAR(30) CHARACTER SET utf8,
                                               `facility_postal_code` VARCHAR(10) CHARACTER SET utf8,
                                               `oid` VARCHAR(24) CHARACTER SET utf8,
                                               `full_id` VARCHAR(29) CHARACTER SET utf8
);
